import { useState, useEffect } from "react";
import "./App.css";
import { PageOne } from "./components/PageOne";
import { PageTwo } from "./components/PageTwo";
import { PageThree } from "./components/PageThree";

function App() {
  const [page, setPage] = useState(1);
  useEffect(() => {}, [page]);
  const handelPage = () => {
    setPage(page + 1);
  };
  const handelSkip = () => {
    setPage(page + 4);
  };
  return (
    <>
      {page === 1 ? (
        <PageOne handelPage={handelPage} handelSkip={handelSkip} />
      ) : page === 2 ? (
        <PageTwo handelPage={handelPage} handelSkip={handelSkip} />
      ) : page === 3 ? (
        <PageThree handelPage={handelPage} handelSkip={handelSkip} />
      ) : (
        <h1>Sign Up Page</h1>
      )}
      {/* <ScreenOne/> */}
      {/* <ScreenTwo /> */}
      {/* <ScreenThree /> */}
    </>
  );
}

export default App;
